import './Standings.css';

const Board = ({ standings, setStandings }) => {
  return (
    <section>
      <article>
      {standings.map((team, key) => <Table standings={standings} setStandings={setStandings} index={key} key={key}/>)}
      </article>
    </section>
  )
};

export default Board;
